import React from "react";
import axios from "axios";

const url = "https://covid19.mathdro.id/api";

const fetchData = async () => {
  try {
    const resolve = await axios.get(url);
    return resolve;
  } catch (err) {
    console.log(err);
  }
};

export default fetchData;
